-------------------------
--诊治所见项目：若干调整
-------------------------
--由于新系统不支持日期类型的诊治所见项目，将所有替换项目中的日期型处理为文本
Update 诊治所见项目 Set 类型 = 1, 长度 = Decode(Instr(中文名, '时间'), 0, 14, 23) Where 替换域 = 1 And 类型 = 2;
Update 诊治所见项目 Set 类型 = 1, 长度 =  23 Where 中文名 In ('当前时间','就诊时间','入院日期','出院日期') And 替换域 = 1;
Update 诊治所见项目 Set 类型 = 1, 长度 =  14 Where 中文名 In ('当前日期','出生日期') And 替换域 = 1;
--将'是否急诊'处理为字符型
Update 诊治所见项目 Set 类型 = 1, 长度 = 4 Where 替换域 = 1 And 类型 = 3;
--将'年龄'处理为字符型
Update 诊治所见项目 Set 类型 = 1, 长度 = 8, 小数 = 0, 单位= '' Where 替换域 = 1 And 编码 = '102003' And 中文名='年龄';

--补充的替换项目
Insert Into 诊治所见项目
   (Id, 分类id, 编码, 中文名, 英文名, 替换域, 类型, 长度, 小数, 单位, 临床意义, 表示法, 性别域, 数值域, 正常域, 初始值, 文字表述, 空值文字)
Select 诊治所见项目_Id.Nextval, k.分类id, a.编码, a.中文名, a.英文名, 1, a.类型, a.长度, a.小数, a.单位, '', 0, 0, '', '', '', 0, ''
From (Select k.分类id From 诊治所见项目 k Where k.中文名 = '住院号') k,
     (Select '105014' As 编码, '住院天数' As 中文名, 'ZYTS' As 英文名, 0 As 类型, 5 As 长度, 0 As 小数, '天' As 单位 From Dual Union All
      Select '105015' As 编码, '入院方式' As 中文名, 'RYFS' As 英文名, 1 As 类型, 10 As 长度, 0 As 小数, '' As 单位 From Dual Union All
      Select '105016' As 编码, '护理等级' As 中文名, 'HLDJ' As 英文名, 1 As 类型, 20 As 长度, 0 As 小数, '' As 单位 From Dual Union All
      Select '105017' As 编码, '出院方式' As 中文名, 'CYFS' As 英文名, 1 As 类型, 10 As 长度, 0 As 小数, '' As 单位 From Dual Union All
      Select '105018' As 编码, '入科时间' As 中文名, 'RKSJ' As 英文名, 1 As 类型, 23 As 长度, 0 As 小数, '' As 单位 From Dual) a,
     (Select e.编码 From 诊治所见项目 e Where e.编码 In ('105014', '105015', '105016', '105017', '105018')) e
Where a.编码 = e.编码(+) And e.编码 Is Null;

Insert Into 诊治所见项目
   (Id, 分类id, 编码, 中文名, 英文名, 替换域, 类型, 长度, 小数, 单位, 临床意义, 表示法, 性别域, 数值域, 正常域, 初始值, 文字表述, 空值文字)
Select 诊治所见项目_Id.Nextval, k.分类id, a.编码, a.中文名, a.英文名, 1, a.类型, a.长度, a.小数, a.单位, '', 0, 0, '', '', '', 0, ''
From (Select k.分类id From 诊治所见项目 k Where k.中文名 = '最后诊断') k,
     (Select '106003' As 编码, '病人主诉' As 中文名, 'BRZS' As 英文名, 1 As 类型, 50 As 长度, 0 As 小数, '' As 单位 From Dual Union All
      Select '106004' As 编码, '现病史' As 中文名, 'XBS' As 英文名, 1 As 类型, 500 As 长度, 0 As 小数, '' As 单位 From Dual Union All
      Select '106005' As 编码, '体格检查' As 中文名, 'FZJC' As 英文名, 1 As 类型, 500 As 长度, 0 As 小数, '' As 单位 From Dual Union All
      Select '106006' As 编码, '辅助检查' As 中文名, 'FZJC' As 英文名, 1 As 类型, 500 As 长度, 0 As 小数, '' As 单位 From Dual Union All
      Select '106007' As 编码, '病历摘要' As 中文名, 'BLZY' As 英文名, 1 As 类型, 500 As 长度, 0 As 小数, '' As 单位 From Dual Union All
	  Select '106008' As 编码, '专科检查' As 中文名, 'ZKJC' As 英文名, 1 As 类型, 500 As 长度, 0 As 小数, '' As 单位 From Dual) a,
     (Select e.编码 From 诊治所见项目 e Where e.编码 In ('106003','106004','106005','106006','106007','106008')) e
Where a.编码 = e.编码(+) And e.编码 Is Null;


--字典类诊治要素项目
Insert Into 诊治所见分类 (性质, Id, 上级id, 编码, 名称, 简码)
Select 1, 诊治所见分类_Id.Nextval, Null, 编码, 名称, 简码
From (Select '08' As 编码, '疾病诊断字典' As 名称, 'JBZDZD' As 简码 From Dual Union All
      Select '09' As 编码, '药物名称字典' As 名称, 'YWMCZD' As 简码 From Dual Union All
      Select '10' As 编码, '诊疗项目字典' As 名称, 'ZLXMZD' As 简码 From Dual Union All
      Select '11' As 编码, '其他基础字典' As 名称, 'QTJCZD' As 简码 From Dual) n
Where Not Exists(Select 1 From 诊治所见分类 O Where 性质 = 1 And o.编码=n.编码);

Delete 诊治所见项目 Where 分类id In (Select Id From 诊治所见分类 Where 性质 = 1 And 编码 In ('08', '09','10','11'));

Insert Into 诊治所见项目 (Id, 分类id, 编码, 中文名, 英文名, 替换域, 类型, 长度, 小数, 单位, 临床意义, 表示法, 性别域, 数值域)
Select 诊治所见项目_Id.Nextval, k.Id, d.编码, d.名称, Zlspellcode(d.名称), 2, 1, 200, 0, '', d.意义, 5, 0, d.值域
From 诊治所见分类 k,
     (Select '08' As 类码, '108-01' As 编码, 'ICD疾病编码' As 名称, 'ICD-10国际疾病统计编码项目' As 意义,'ZLV_ICD疾病编码' As 值域 From Dual Union All
      Select '08' As 类码, '108-02' As 编码, '损伤中毒外因' As 名称, '损伤与中毒的外部原因的统计编码项目' As 意义,'ZLV_损伤中毒外因' As 值域 From Dual Union All
      Select '08' As 类码, '108-03' As 编码, '肿瘤编码' As 名称, '肿瘤形态学国际统计编码项目' As 意义,'ZLV_肿瘤编码' As 值域 From Dual Union All
      Select '08' As 类码, '108-04' As 编码, 'ICD手术编码' As 名称, 'ICD-9-CM3国际手术统计编码项目' As 意义,'ZLV_ICD手术编码' As 值域 From Dual Union All
      Select '08' As 类码, '108-05' As 编码, '中医疾病' As 名称, '国家中医疾病编码项目' As 意义,'ZLV_中医疾病' As 值域 From Dual Union All
      Select '08' As 类码, '108-06' As 编码, '中医病证' As 名称, '国家中医病证编码项目' As 意义,'ZLV_中医病证' As 值域 From Dual Union All
      Select '08' As 类码, '108-07' As 编码, '西医常见病' As 名称, '常用的西医疾病诊断名称' As 意义,'ZLV_西医常见病' As 值域 From Dual Union All
      Select '08' As 类码, '108-08' As 编码, '中医常见病' As 名称, '常用的中医疾病诊断名称' As 意义,'ZLV_中医常见病' As 值域 From Dual Union All
      Select '08' As 类码, '108-09' As 编码, '常见传染病' As 名称, '常用的传染病名称' As 意义,'ZLV_常见传染病' As 值域 From Dual Union All
      Select '09' As 类码, '109-01' As 编码, '西药名称' As 名称, '医院使用的西药药物名称' As 意义,'ZLV_西药名称' As 值域 From Dual Union All
      Select '09' As 类码, '109-02' As 编码, '中成药名称' As 名称, '医院使用的中成药药品名称' As 意义,'ZLV_中成药名称' As 值域 From Dual Union All
      Select '09' As 类码, '109-03' As 编码, '草药名称' As 名称, '医院使用的中草药名称' As 意义,'ZLV_草药名称' As 值域 From Dual Union All
      Select '09' As 类码, '109-04' As 编码, '草药配方' As 名称, '医院常用草药配方名称' As 意义,'ZLV_草药配方' As 值域 From Dual Union All
      Select '10' As 类码, '110-01' As 编码, '检验项目' As 名称, '医院使用的检验项目' As 意义,'ZLV_检验项目' As 值域 From Dual Union All
      Select '10' As 类码, '110-02' As 编码, '检查项目' As 名称, '医院使用的检查项目' As 意义,'ZLV_检查项目' As 值域 From Dual Union All
      Select '10' As 类码, '110-03' As 编码, '治疗项目' As 名称, '医院使用的治疗项目' As 意义,'ZLV_治疗项目' As 值域 From Dual Union All
      Select '10' As 类码, '110-04' As 编码, '手术项目' As 名称, '医院使用的手术项目' As 意义,'ZLV_手术项目' As 值域 From Dual Union All
      Select '10' As 类码, '110-05' As 编码, '麻醉项目' As 名称, '医院使用的麻醉项目' As 意义,'ZLV_麻醉项目' As 值域 From Dual Union All
      Select '10' As 类码, '110-06' As 编码, '护理等级' As 名称, '医院使用的护理登记' As 意义,'ZLV_护理等级' As 值域 From Dual Union All
      Select '10' As 类码, '110-07' As 编码, '护理常规' As 名称, '医院使用的护理常规项目' As 意义,'ZLV_护理常规' As 值域 From Dual Union All
      Select '10' As 类码, '110-08' As 编码, '膳食项目' As 名称, '医院使用的膳食项目' As 意义,'ZLV_膳食项目' As 值域 From Dual Union All
      Select '10' As 类码, '110-09' As 编码, '输血项目' As 名称, '医院使用的输血项目' As 意义,'ZLV_输血项目' As 值域 From Dual Union All
      Select '10' As 类码, '110-10' As 编码, '输氧项目' As 名称, '医院使用的输氧项目' As 意义,'ZLV_输氧项目' As 值域 From Dual Union All
      Select '10' As 类码, '110-11' As 编码, '其他诊疗' As 名称, '医院使用的其他诊疗项目' As 意义,'ZLV_其他诊疗' As 值域 From Dual Union All
      Select '11' As 类码, '111-01' As 编码, '部门' As 名称, '医院各个科室部门' As 意义,'部门表' As 值域 From Dual Union All
      Select '11' As 类码, '111-02' As 编码, '人员' As 名称, '医院工作人员' As 意义,'ZLV_人员' As 值域 From Dual Union All
      Select '11' As 类码, '111-03' As 编码, '地区' As 名称, '病案主页要求统计的费用项目' As 意义,'地区' As 值域 From Dual Union All
      Select '11' As 类码, '111-04' As 编码, '检查类型' As 名称, '检查类别划分' As 意义,'诊疗检查类型' As 值域 From Dual Union All
      Select '11' As 类码, '111-05' As 编码, '检验标本' As 名称, '检验过程依靠的各种标本' As 意义,'诊疗检验标本' As 值域 From Dual Union All
      Select '11' As 类码, '111-06' As 编码, '检验类型' As 名称, '检验项目的类别(如生化类、临检类、微生物类等)' As 意义,'诊疗检验类型' As 值域 From Dual Union All
      Select '11' As 类码, '111-07' As 编码, '麻醉类型' As 名称, '各种麻醉方式的类型划分' As 意义,'诊疗麻醉类型' As 值域 From Dual Union All
      Select '11' As 类码, '111-08' As 编码, '手术规模' As 名称, '手术操作的规模大小划分' As 意义,'诊疗手术规模' As 值域 From Dual Union All
      Select '11' As 类码, '111-09' As 编码, '手术岗位' As 名称, '手术过程中的手术角色分类编码' As 意义,'手术岗位' As 值域 From Dual) d
Where k.性质 = 1 And k.编码 = d.类码 And Not Exists(Select 1 From 诊治所见项目 e Where e.编码 = d.编码);
Commit;

