      Select '13' As 类码, '113-09' As 编码, '样本条码' As 名称, 18 As 长度 From Dual Union All
      Select '13' As 类码, '113-10' As 编码, '标本序号' As 名称, 10 As 长度 From Dual Union All
      Select '13' As 类码, '113-11' As 编码, '标本类型' As 名称, 30 As 长度 From Dual Union All
      Select '13' As 类码, '113-12' As 编码, '核收人' As 名称, 20 As 长度 From Dual Union All
      Select '13' As 类码, '113-13' As 编码, '核收时间' As 名称, 23 As 长度 From Dual Union All
      Select '13' As 类码, '113-14' As 编码, '检验人' As 名称, 20 As 长度 From Dual Union All
      Select '13' As 类码, '113-15' As 编码, '检验时间' As 名称, 23 As 长度 From Dual Union All
      Select '13' As 类码, '113-16' As 编码, '审核人' As 名称, 20 As 长度 From Dual Union All
      Select '13' As 类码, '113-17' As 编码, '审核时间' As 名称, 23 As 长度 From Dual Union All
      Select '13' As 类码, '113-18' As 编码, '检验评语' As 名称, 200 As 长度 From Dual Union All
      Select '13' As 类码, '113-19' As 编码, '检验备注' As 名称, 200 As 长度 From Dual Union All
      Select '13' As 类码, '113-20' As 编码, '检验项目' As 名称, 10 As 长度 From Dual Union All
      Select '13' As 类码, '113-21' As 编码, '影像类别' As 名称, 20 As 长度 From Dual Union All
      Select '13' As 类码, '113-22' As 编码, '检查号' As 名称, 18 As 长度 From Dual) d
Where k.性质 = 1 And k.编码 = d.类码 And Not Exists(Select 1 From 诊治所见项目 e Where e.编码 = d.编码);

Update 诊治所见项目 Set 英文名=zlSpellCode(中文名) Where 替换域 = 1;
