Union All Select 333,5,275,69,2,-Null,-Null,'0',-Null,'：皮肤无黄染稍显苍白，温湿度适中，弹性尚好，无淤点淤斑、蜘蛛痣、肝掌和杵状指趾。全身淋巴结均未触及。头形正常，双睑不浮肿，巩膜无黄染，眼结膜稍苍白，双侧瞳孔等大形圆，耳廓无畸形，耳道无溢液，乳突无压痛。鼻腔通畅，鼻窦无压痛。口有秽味，唇色苍白，无龋齿及龈血，舌质淡红，舌苔黄白略燥，扁桃体无肿大。颈软，颈静脉无怒张，肝颈静脉反流征阴性，气管居中。胸廓对称，呼吸均匀，扣为清音。心界正常，心率90次/分，律齐，二尖瓣听诊区闻及Ⅱ级吹风样收缩期杂音。腹部平坦，无浅静脉曲张及肠型胃型，触诊柔软，脐上两厘米稍偏右处有局限性轻压痛感，无反跳痛及包块。肝肋下0.5厘米，质软，缘锐，无压痛，脾未触及，无移动性浊音，肝肾区无叩痛。肠鸣音活跃无高调。直肠指诊指套糊有黑便，未触及狭窄与包块，前列腺为发现异常，外生殖器及脊柱四肢无异常，病理反射阴性。',1,-Null,-Null,'',-Null,0,'',-Null,-Null,-Null,'',0,0,'' From Dual;
Commit;
