--病历范文内容的提纲处理
Update 病历范文内容 Set 预制提纲id = Null Where 预制提纲id In (-3, -4, -5, -6, -7, -8, -9);
Update 病历范文内容 A Set 定义提纲id = (Select Max(x.Id) From 病历文件结构 X Where A.文件id = X.文件id And A.预制提纲id = X.预制提纲id);
Commit;

